    gridContainer: {
      paddingLeft: "20px",
      paddingRight: "20px",
      background:"#7555D9",
      minHeight:"100vh"
    },
    formcategory:{
      marginBottom:"100px"  
    }
  });

function Form() {
    const classes = useStyles();
  return (
    <Grid
    container
    className={classes.gridContainer}
    justify="center"
  >
    <Grid item xs={12} sm={6} md={3} className={classes.head}>
    <h3 className="text1">Choose your</h3>
    <h3 className="text2">Category</h3>
    </Grid>
    <Grid
    container
    justify="center"
  >
    <Grid item xs={12} sm={6} md={6}lg={4} className={classes.formcategory} >
    <Card className="form-card">
         <h3 className="language">Select Language:</h3>
         <div className="custom-select">
   <select className="lang">
    <option value="0" className="opt">Select car:</option>
    <option value="1" className="opt">Audi</option>
    <option value="2" className="opt">BMW</option>

  </select>
</div>

      <h3 className="language">Full Name:</h3>
      <div className="form-group">

      </div>

    </Card>
    </Grid>
    </Grid>


  </Grid>
  );
}

export default Form
